import React, { useEffect, useState, FormEvent } from 'react';
import axios from 'axios';

type Todo = {
  id: number;
  title: string;
  completed: boolean;
  createdAt: string;
};

const App: React.FC = () => {
  const [todos, setTodos] = useState<Todo[]>([]);
  const [title, setTitle] = useState('');

  const fetchTodos = async () => {
    try {
      const res = await axios.get<Todo[]>('/api/todos');
      setTodos(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchTodos();
  }, []);

  const addTodo = async (e: FormEvent) => {
    e.preventDefault();
    if (!title.trim()) return;
    const res = await axios.post<Todo>('/api/todos', { title });
    setTodos(prev => [...prev, res.data]);
    setTitle('');
  };

  const toggle = async ( todo: Todo ) => {
    const res = await axios.put<Todo>(`/api/todos/${todo.id}`, { completed: !todo.completed });
    setTodos(prev => prev.map(t => (t.id === todo.id ? res.data : t)));
  };

  const remove = async (id: number) => {
    await axios.delete(`/api/todos/${id}`);
    setTodos(prev => prev.filter(t => t.id !== id));
  };

  return (
    <div style={{ padding: 20 }}>
      <h1>Todos</h1>
      <form onSubmit={addTodo} style={{ display: 'flex', gap: 8, marginBottom: 12 }}>
        <input
          value={title}
          onChange={e => setTitle(e.target.value)}
          placeholder="New todo"
          style={{ flex: 1, padding: '8px 10px' }}
        />
        <button type="submit">Add</button>
      </form>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {todos.map(t => (
          <li key={t.id} style={{ display: 'flex', alignItems: 'center', gap: 8, padding: '6px 0' }}>
            <input type="checkbox" checked={t.completed} onChange={() => toggle(t)} />
            <span style={{ textDecoration: t.completed ? 'line-through' : 'none' }}>{t.title}</span>
            <span style={{ marginLeft: 'auto', color: '#888', fontSize: 12 }}>{new Date(t.createdAt).toLocaleString()}</span>
            <button onClick={() => remove(t.id)} style={{ marginLeft: 8 }}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default App;

